// src/pages/Home.js
import React from 'react';
import { Link } from 'react-router-dom';
import { motion } from 'framer-motion';

const Home = () => {
  return (
    <div className="min-h-screen flex flex-col justify-between bg-gray-100">
      {/* Navbar */}
      <header className="bg-blue-800 text-white p-4">
        <nav className="container mx-auto flex justify-between items-center">
          <h1 className="text-2xl font-bold">Mohamed Ali</h1>
          <ul className="flex space-x-6">
            <li><Link to="/" className="hover:underline">Home</Link></li>
            <li><Link to="/about" className="hover:underline">About</Link></li>
            <li><Link to="/projects" className="hover:underline">Projects</Link></li>
            <li><Link to="/techstack" className="hover:underline">Tech Stack</Link></li>
          </ul>
        </nav>
      </header>

      {/* Hero Section */}
      <motion.main
        className="hero flex flex-col items-center bg-gradient-to-r from-blue-200 via-blue-100 to-blue-300 p-8"
        initial={{ opacity: 0 }}
        animate={{ opacity: 1 }}
        transition={{ duration: 1 }}
      >
        <div className="hero-content flex flex-col md:flex-row items-center gap-8">
          {/* Hero Text */}
          <motion.div
            className="hero-text text-center md:text-left"
            initial={{ x: -50, opacity: 0 }}
            animate={{ x: 0, opacity: 1 }}
            transition={{ type: "spring", stiffness: 100, duration: 0.8 }}
          >
            <h2 className="text-3xl md:text-4xl font-bold text-blue-700">
              Building modern, scalable web applications
            </h2>
            <p className="mt-4 text-lg text-blue-600">
              Welcome! I'm Mohamed Ali, a developer passionate about creating clean and efficient code. Explore my work and skills below.
            </p>
            <Link
              to="/projects"
              className="mt-6 inline-block bg-blue-600 text-white py-2 px-4 rounded-md hover:bg-blue-700 transition duration-300"
            >
              View My Work
            </Link>
          </motion.div>

          {/* Hero Image */}
          <motion.div
            className="hero-image"
            initial={{ scale: 0.8, opacity: 0 }}
            animate={{ scale: 1, opacity: 1 }}
            transition={{ type: "spring", stiffness: 120, duration: 1 }}
          >
            <img src="/Images/chen-Qtu3hGinLF8-unsplash.jpg" alt="Coding at Work" className="max-w-sm rounded-lg shadow-lg" />
          </motion.div>
        </div>
      </motion.main>

      {/* Footer */}
      <footer className="bg-gray-800 text-white py-4">
        <div className="container mx-auto text-center">
          <div className="flex justify-center space-x-6 mb-2">
            <motion.a
              href="https://github.com/m75-ali"
              target="_blank"
              rel="noopener noreferrer"
              className="hover:underline"
              whileHover={{ scale: 1.1 }}
              transition={{ type: "spring", stiffness: 300 }}
            >
              GitHub
            </motion.a>
            <motion.a
              href="https://www.linkedin.com/in/alimohamed5981/"
              target="_blank"
              rel="noopener noreferrer"
              className="hover:underline"
              whileHover={{ scale: 1.1 }}
              transition={{ type: "spring", stiffness: 300 }}
            >
              LinkedIn
            </motion.a>
            <motion.a
              href="mailto:ali.mohamed5981@gmail.com"
              className="hover:underline"
              whileHover={{ scale: 1.1 }}
              transition={{ type: "spring", stiffness: 300 }}
            >
              Email
            </motion.a>
          </div>
          <p>&copy; 2024 Mohamed Ali. All rights reserved.</p>
        </div>
      </footer>
    </div>
  );
};

export default Home;
